commits.content:
html{
    scroll-behavior: smooth;
}
body {
      font-family: "Work Sans", sans-serif;


}
.container{
    margin-left: auto;
    margin-right: auto;
    padding-left: 15px;
    padding-right: 15px;
}
/* Small */
@media (min-width: 768px) {
  .container {
    width: 750px;
  }
}
/* Medium */
@media (min-width: 992px) {
  .container {
    width: 970px;
  }
}
/* Large */
@media (min-width: 1200px) {
  .container {
    width: 1170px;
  }
}
ul{
    list-style: none;
}
a{
    text-decoration: none;
} 


 .main-heading{
text-align: center;

}
.main-heading h2{ 
  font-size: 40px;
    position: relative;
    font-weight: normal;
    margin-bottom: 70px;
     text-transform: uppercase;

}
.main-heading p{
  width: 550px;
  max-width: 100%;
  line-height:2;
  color: #777;
  margin: 0 auto 100px;
}
.main-heading h2:after{
content: "";
    border: 2px solid #333;
    position: absolute;
    width: 14px;
    height: 14px;
    border-radius: 50%;
    background-color: white;
    bottom: -38px;
    left: 50%;
    transform: translateX(-50%);
}
.main-heading h2::before{
content: "";
    position: absolute;
    left: 50%;
    transform: translateX(-50%);
    width: 120px;
    height: 2px;
    background-color: #333;
    bottom: -30px;

}
